import React, { useState, useEffect } from "react";
import "./card.css";
import { Tooltip } from "@material-ui/core";
import axios from "axios";
import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";

const Card = () => {
  const [topAlbums, setTopAlbums] = useState([]);
  const [newAlbums, setNewAlbums] = useState([]);
  const [expanded, setExpanded] = useState(false);

  useEffect(() => {
    fetchTopAlbums();
    fetchNewAlbums();
  }, []);

  const fetchNewAlbums = async () => {
    try {
      const response = await axios.get(
        "https://qtify-backend-labs.crio.do/albums/new"
      );
      const simplifiedData = response.data.map((album) => ({
        id: album.id,
        image: album.image,
        follows: album.follows,
        title: album.title,
      }));
      setNewAlbums(simplifiedData);
    } catch (error) {
      console.error("Error fetching new albums:", error);
    }
  };

  const fetchTopAlbums = async () => {
    try {
      const response = await axios.get(
        "https://qtify-backend-labs.crio.do/albums/top"
      );
      const simplifiedData = response.data.map((album) => ({
        id: album.id,
        image: album.image,
        follows: album.follows,
        title: album.title,
      }));
      setTopAlbums(simplifiedData);
    } catch (error) {
      console.error("Error fetching top albums:", error);
    }
  };

  const handleToggleExpand = () => {
    setExpanded(!expanded);
  };

  return (
    <div className="grid">
      <div className="heading1">
        <div>Top Albums</div>
        {topAlbums.length > 7 && (
          <div onClick={handleToggleExpand} className="headingSub">
            {expanded ? "Collapse" : "Show All"}
          </div>
        )}
      </div>

      <div className="card-container">
        <Carousel
          showThumbs={false}
          showStatus={false}
          infiniteLoop
          renderArrowPrev={(onClickHandler, hasPrev, label) =>
            hasPrev && (
              <button
                type="button"
                onClick={onClickHandler}
                title={label}
                className="carousel-button carousel-button-prev"
              >
                Previous
              </button>
            )
          }
          renderArrowNext={(onClickHandler, hasNext, label) =>
            hasNext && (
              <button
                type="button"
                onClick={onClickHandler}
                title={label}
                className="carousel-button carousel-button-next"
              >
                Next
              </button>
            )
          }
        >
          {topAlbums.map((album) => (
            <div key={album.id} className="card">
              <Tooltip title={`${65} Songs`} placement="top">
                <img src={album.image} alt="cardImg" />
              </Tooltip>
              <div>
                <p className="card-follows">{album.follows} Follows</p>
              </div>
              <p className="card-title">{album.title}</p>
            </div>
          ))}
        </Carousel>
      </div>
      <br />

      <div className="heading1">
        <div>New Albums</div>
        {newAlbums.length > 7 && (
          <div onClick={handleToggleExpand} className="headingSub">
            {expanded ? "Collapse" : "Show All"}
          </div>
        )}
      </div>
      <div className="card-container">
        <Carousel
          showThumbs={false}
          showStatus={false}
          infiniteLoop
          renderArrowPrev={(onClickHandler, hasPrev, label) =>
            hasPrev && (
              <button
                type="button"
                onClick={onClickHandler}
                title={label}
                className="carousel-button carousel-button-prev"
              >
                Previous
              </button>
            )
          }
          renderArrowNext={(onClickHandler, hasNext, label) =>
            hasNext && (
              <button
                type="button"
                onClick={onClickHandler}
                title={label}
                className="carousel-button carousel-button-next"
              >
                Next
              </button>
            )
          }
        >
          {newAlbums.map((album) => (
            <div key={album.id} className="card">
              <Tooltip title={`${65} Songs`} placement="top">
                <img src={album.image} alt="cardImg" />
              </Tooltip>
              <div>
                <p className="card-follows">{album.follows} Follows</p>
              </div>
              <p className="card-title">{album.title}</p>
            </div>
          ))}
        </Carousel>
      </div>
    </div>
  );
};

export default Card;
